package ru.tatyana.demo.model;/** * Created by Tatyana on 14.04.2016. */public class Pyramid {    private Long year;    private Long month;    private Long patients;    public Pyramid() {}    public Pyramid(Long year, Long month, Long patients) {        this.year = year;        this.month = month;        this.patients = patients;    }    public Long getYear() {        return year;    }    public void setYear(Long year) {        this.year = year;    }    public Long getMonth() {        return month;    }    public void setMonth(Long month) {        this.month = month;    }    public Long getPatients() {        return patients;    }    public void setPatients(Long patients) {        this.patients = patients;    }}